import React, { Component } from 'react';

export default class ImageUpload extends Component {
    render() {
        return (
            <Dragger {...props}>
            <div style={{width: '100%'}}>
                <p className="ant-upload-drag-icon">
                    <Icon type="inbox" />
                </p>
                <p className="ant-upload-text">Click or drag file to this area to upload</p>
            </div>
        </Dragger>
        )
    }
}
